import React, { Component } from 'react';
import '../css/SocialFollow.css';

const fbIcon = "../images/fbIcon.png"
const fbLink = "https://www.facebook.com/DynamicsPerformanceTeam/"

const igIcon = ".././images/igIcon.png"
const igLink = "https://www.instagram.com/dynamicsperformanceteam/?hl=en"

const yelpIcon = "../images/yelpIcon.png"
const yelpLink = "https://www.yelp.com/biz/dynamics-performance-team-san-jose"

class SocialFollow extends Component{
    render(){
        return(
            <div className="Social">
              <ul>
                <SocialIcon icon={fbIcon} link={fbLink}/>
                <SocialIcon icon={igIcon} link={igLink}/>
                <SocialIcon icon={yelpIcon} link={yelpLink}/>

                <li><a href="mailto:dynamicsperformanceteam@gmail.com?subject=I'd like to join Dynamics Dance Performance's newsletter!"><i class="fas fa-envelope-open-text"></i> Subscribe</a></li>
              </ul>
            </div>
        );
    }
}


const SocialIcon = props =>
  <li>
    <a href={props.link}>
      <img src={props.icon}></img>
    </a>
  </li>;

export default SocialFollow;
